apiVersion: operators.coreos.com/v1alpha1
kind: ClusterServiceVersion
metadata:
  annotations:
    alm-examples: |-
      [
        {
          "apiVersion": "secure.waratek.com/v1alpha1",
          "kind": "WaratekSecure",
          "metadata": {
            "name": "example-warateksecure"
          },
          "spec": {
            "size": 3
          }
        }
      ]
    capabilities: Basic Install
    categories: Security
    description: Operator to perform Waratek Secure installation on OpenShift.
    containerImage: quay.io/mbagnall/waratek-test:v0.0.1
    createdAt: 2020-02-27 12:06
    support: Waratek Ltd
    certified: "false"
    repository: https://github.com/mbagnall/waratek-operator
  name: waratek-operator.v0.0.1
  namespace: placeholder
spec:
  apiservicedefinitions: {}
  customresourcedefinitions:
    owned:
      - kind: WaratekSecure
        displayName: Waratek Operator
        name: warateksecures.secure.waratek.com
        version: 0.0.1
  description: Use this operator to deploy Waratek Secure in an OpenShift environment. Within their OpenShift CR, customers will need to specify the set of servers to deploy to and also the download link for the Waratek release to be deployed.
  displayName: Waratek Operator
  icon:
    - base64data: 
      mediatype: image/png
  install:
    spec:
      deployments:
      - name: waratek-operator
        spec:
          replicas: 1
          selector:
            matchLabels:
              name: waratek-operator
          strategy: {}
          template:
            metadata:
              labels:
                name: waratek-operator
            spec:
              containers:
              - command:
                - /usr/local/bin/ao-logs
                - /tmp/ansible-operator/runner
                - stdout
                image: quay.io/mbagnall/waratek-test
                imagePullPolicy: Always
                name: ansible
                resources: {}
                volumeMounts:
                - mountPath: /tmp/ansible-operator/runner
                  name: runner
                  readOnly: true
              - env:
                - name: WATCH_NAMESPACE
                  valueFrom:
                    fieldRef:
                      fieldPath: metadata.annotations['olm.targetNamespaces']
                - name: POD_NAME
                  valueFrom:
                    fieldRef:
                      fieldPath: metadata.name
                - name: OPERATOR_NAME
                  value: waratek-operator
                - name: ANSIBLE_GATHERING
                  value: explicit
                image: quay.io/mbagnall/waratek-test
                imagePullPolicy: Always
                name: operator
                resources: {}
                volumeMounts:
                - mountPath: /tmp/ansible-operator/runner
                  name: runner
              serviceAccountName: waratek-operator
              volumes:
              - emptyDir: {}
                name: runner
      permissions:
      - rules:
        - apiGroups:
          - ""
          resources:
          - pods
          - services
          - services/finalizers
          - endpoints
          - persistentvolumeclaims
          - events
          - configmaps
          - secrets
          verbs:
          - create
          - delete
          - get
          - list
          - patch
          - update
          - watch
        - apiGroups:
          - apps
          resources:
          - deployments
          - daemonsets
          - replicasets
          - statefulsets
          verbs:
          - create
          - delete
          - get
          - list
          - patch
          - update
          - watch
        - apiGroups:
          - monitoring.coreos.com
          resources:
          - servicemonitors
          verbs:
          - get
          - create
        - apiGroups:
          - apps
          resourceNames:
          - waratek-operator
          resources:
          - deployments/finalizers
          verbs:
          - update
        - apiGroups:
          - ""
          resources:
          - pods
          verbs:
          - get
        - apiGroups:
          - apps
          resources:
          - replicasets
          - deployments
          verbs:
          - get
        - apiGroups:
          - secure.waratek.com
          resources:
          - '*'
          verbs:
          - create
          - delete
          - get
          - list
          - patch
          - update
          - watch
        serviceAccountName: waratek-operator
    strategy: deployment
  installModes:
  - supported: true
    type: OwnNamespace
  - supported: true
    type: SingleNamespace
  - supported: false
    type: MultiNamespace
  - supported: true
    type: AllNamespaces
  maturity: alpha
  keywords:
    - java
      application-security
  links:
    - name: Waratek Secure
      url: https://www.waratek.com
  maintainers:
    - name: Waratek Ltd
      email: mbagnall@waratek.com
  provider: 
      name: Waratek Ltd
  version: 0.0.1
